import { Component } from "react";
import React from "react";
import { Link } from "react-router-dom";
import { Redirect } from "react-router-dom";
import CardCatalogoEspecifico from "./Cards/CardCatalogoEspecifico";
import { Fragment } from "react";
import $ from "jquery";

class CatalogoEspecifico extends React.Component {
  constructor() {
    super();
    this.id = sessionStorage.getItem("IdCatalogo");
    //sessionStorage.setItem("IdCatalogo", "");
    this.servicos = this.getAll(sessionStorage.getItem("IdCatalogo"));
  }

  getAll(id) {
    $.ajax({
      type: "get",
      contentType: "application/json;charset=UTF-8",
      async: false,
      url: "http://localhost:8080/Servicos/Categoria?categoria=" + id
    })
      .done(function(msg) {
        console.log(msg);
        this.servicos = JSON.stringify(msg);
      })
      .fail(function(jqXHR, textStatus, msg) {
        console.log(jqXHR);
        console.log(textStatus);
        console.log(msg);
      });
  }

  render() {
    return (
      <Fragment>
        <h4 className="text-secondary" align="center">
          Catálogo específico
        </h4>
        <div className="row" align="center">
          {this.servicos.map((servico, i) => {
            console.log("Entered");
            return <CardCatalogoEspecifico key={i} servico={servico} />;
          })}
        </div>
      </Fragment>
    );
  }
}

export default CatalogoEspecifico;
